import { Typography } from '@mui/material';
import { Stack } from '@mui/system';
import React from 'react';
import DetailTable from '../DetailTable';
import TermsInfo from '../TermsInfo';

const Header = () => {
    return (
       <Stack>
            <Stack direction='column' alignItems="center">
                <img
                    width="150px"
                    src="data:image/png;base64,"
                    className="rounded float-right align-top"
                />
                <span>Address: #95 Yanga st. maysilo malabon</span>
                <span>Contact No.: 09554223366</span>
            </Stack>
            <Stack direction='column' sx={{ marginBottom: '30px' }}>
                <Stack justifyContent="space-between" direction='row' spacing={2.5}>
                    <Typography variant="h5">
                        Stephen anino
                    </Typography>
                </Stack>
                <Stack justifyContent="space-between" direction='row' spacing={2.5} alignItems="center">
                    <div>
                        Invoice date: May 24, 2024
                    </div>
                    <div>
                        Address: San francisco CA, 64103
                    </div>
                </Stack>
                <Stack justifyContent="space-between" direction='row' spacing={2.5} alignItems="center">
                    <div>
                        Invoice No.: 123123123123
                    </div>
                    <div>
                        Salcedo malate manila
                    </div>
                </Stack>
            </Stack>
       </Stack>
    );
}

const Body = ({ data }) => {
    return (
        <>
            <TermsInfo data={data?.data} />
            <DetailTable data={data}/>
        </>
    );
}

const Printable = ({ data }) => {
    return (
        <div id="printable">
            <Header />
            <Body data={data} />
        </div>
    );
};

export default Printable;